import React , { useState} from "react";





function Signup(){


  return (
    
    <div id={"signup-page"}>
    <div id={"signup-header"}>
        <div id={"signup-backButton"}>
            <a href={"/login"}
               className={"arrow left"}>
            </a>
        </div>

        <div id={"signup-signupText"}>
            <h3> Sign Up </h3>
        </div>
    </div>
        
    </div>
    
      
      
  );

}

  
export default Signup;
